// Organization Logos Configuration
// Replace the base64 image strings with your actual organization logos

export interface OrganizationLogo {
  id: string
  name: string
  image: string // Base64 image data or URL
  alt: string
  website?: string // Optional website URL
}

// Helper function to get logo from environment variables or fallback to default
const getLogoFromEnv = (orgNumber: number, fallbackImage: string, fallbackName: string, fallbackWebsite?: string): OrganizationLogo => {
  const envLogoUrl = import.meta.env[`VITE_ORG${orgNumber}_LOGO_URL`]
  const envName = import.meta.env[`VITE_ORG${orgNumber}_NAME`]
  const envWebsite = import.meta.env[`VITE_ORG${orgNumber}_WEBSITE`]

  return {
    id: `org${orgNumber}`,
    name: envName || fallbackName,
    image: envLogoUrl || fallbackImage,
    alt: `${envName || fallbackName} Logo`,
    website: envWebsite || fallbackWebsite
  }
}

export const organizationLogos: OrganizationLogo[] = [
  getLogoFromEnv(
    1,
    // Default base64 fallback for organization 1
    'data:image/svg+xml;base64,',
    'Caraga State University - Computer Science Society',
    'https://www.facebook.com/csucss'
  ),
  getLogoFromEnv(
    2,
    // Default base64 fallback for organization 2
    'data:image/png;base64,',
    'Caraga State University - Society of Information Technology Students',
    'https://www.facebook.com/sites.csu'
  )
  
  // To add more organizations, you can either:
  // 1. Add more getLogoFromEnv() calls here, or
  // 2. Manually add objects like this:
  // {
  //   id: 'org3',
  //   name: 'Your Organization Name',
  //   image: 'data:image/png;base64,YOUR_BASE64_STRING_HERE',
  //   alt: 'Your Organization Logo',
  //   website: 'https://yourorg.com'
  // }
]

// Helper function to add a new organization logo
export const addOrganizationLogo = (logo: OrganizationLogo) => {
  organizationLogos.push(logo)
}

// Helper function to update an existing organization logo
export const updateOrganizationLogo = (id: string, updates: Partial<OrganizationLogo>) => {
  const index = organizationLogos.findIndex(logo => logo.id === id)
  if (index !== -1) {
    organizationLogos[index] = { ...organizationLogos[index], ...updates }
  }
}
